import React,{useState} from 'react';
import '../css/app.css';
import Header from '../../header';
import Top from './Top';
import About from './About';
import Skill from './Skill';

function Home() {

    const [topPage, setTopPage] = useState<boolean>(true);
    const [other, setOther] = useState<boolean>(false);

    const next = () => {
        setTopPage(false);
        setOther(true);
        return 
    }



  return (
    <>
        { other && <Header next={next}/>}
        { topPage && 
            <Top setTopPage={setTopPage} setOther={setOther} next={next}/>
            }
        { other && 
        <div>
            <About />
            <Skill />
        </div>
        }

    </>
  );
}

export default Home;
